import React, { useState, useEffect } from 'react';
import {
    LayoutDashboard, Store, FileText, TrendingUp, Users, DollarSign,
    Zap, Sparkles, Play, Award, Star, MessageCircle, Clock
} from 'lucide-react';
import api from '@landinghub/api';
import '../styles/UserDashboard.css';

const UserDashboard = () => {
    const [stats, setStats] = useState({
        totalPages: 0, totalViews: 0, totalRevenue: '0M',
        livePages: 0, conversionRate: '0%'
    });
    const [loading, setLoading] = useState(true);

    // ========== REAL BACKEND DATA! ==========
    useEffect(() => {
        const fetchStats = async () => {
            try {
                const response = await api.get('api/dashboard/stats');
                setStats(response.data.data);
            } catch (error) {
                console.log('Use mock data:', error);
                // MOCK FALLBACK
                setStats({
                    totalPages: 24, totalViews: '1,247', totalRevenue: '15.2M',
                    livePages: 12, conversionRate: '8.7%'
                });
            } finally {
                setLoading(false);
            }
        };
        fetchStats();
    }, []);

    return (
        <div className="creator-dashboard">
            {/* HERO - UPDATE LIVE PAGES */}
            <section className="creator-hero">
                <div className="creator-hero-content">
                    <div className="creator-badge">
                        <Sparkles size={20} />
                        <span>CREATOR DASHBOARD</span>
                    </div>
                    <h1 className="creator-hero-title">
                        Chào mừng quay lại, <span className="creator-highlight">Creator!</span>
                    </h1>
                    <p className="creator-hero-subtitle">
                        Quản lý <strong>{stats.totalPages}</strong> Landing Pages •
                        <strong>{stats.totalViews}</strong> views •
                        <strong>{stats.totalRevenue}</strong> doanh thu
                    </p>
                    <div className="creator-hero-stats">
                        <div className="creator-stat-item">
                            <TrendingUp size={20} className="creator-icon-green" />
                            <span>{stats.conversionRate} chuyển đổi</span>
                        </div>
                        <div className="creator-stat-item">
                            <Award size={20} className="creator-icon-gold" />
                            <span>{stats.livePages} Pages LIVE</span>
                        </div>
                    </div>
                </div>
                {/* ... 3 IMAGES SAME ... */}
            </section>

            {/* ACCESS CARDS - REAL DATA */}
            <section className="creator-access">
                <div className="creator-access-grid">
                    <button className="creator-access-card marketplace">
                        <Store size={48} />
                        <div>
                            <h3>Marketplace</h3>
                            <p>Bán Templates • Kiếm tiền</p>
                        </div>
                        <Play size={20} className="creator-access-arrow" />
                    </button>

                    <button className="creator-access-card pages">
                        <FileText size={48} />
                        <div>
                            <h3>My Pages</h3>
                            <p>{stats.totalPages} Landing Pages</p>
                        </div>
                        <Play size={20} className="creator-access-arrow" />
                    </button>

                    <button className="creator-access-card earnings">
                        <DollarSign size={48} />
                        <div>
                            <h3>Earnings</h3>
                            <p>{stats.totalRevenue} VNĐ</p>
                        </div>
                        <Play size={20} className="creator-access-arrow" />
                    </button>

                    <button className="creator-access-card analytics">
                        <TrendingUp size={48} />
                        <div>
                            <h3>Analytics</h3>
                            <p>{stats.totalViews} views</p>
                        </div>
                        <Play size={20} className="creator-access-arrow" />
                    </button>
                </div>
            </section>

            {/* STATS ROW - REAL DATA */}
            <section className="creator-stats-row">
                <div className="creator-container">
                    <div className="creator-stat-box">
                        <div className="creator-stat-number">{stats.totalPages}</div>
                        <div className="creator-stat-label">Total Pages</div>
                    </div>
                    <div className="creator-stat-box">
                        <div className="creator-stat-number">{stats.totalRevenue}</div>
                        <div className="creator-stat-label">Doanh thu</div>
                    </div>
                    <div className="creator-stat-box">
                        <div className="creator-stat-number">{stats.totalViews}</div>
                        <div className="creator-stat-label">Views</div>
                    </div>
                    <div className="creator-stat-box">
                        <div className="creator-stat-number">{stats.conversionRate}</div>
                        <div className="creator-stat-label">Conversion</div>
                    </div>
                </div>
            </section>
        </div>
    );
};

export default React.memo(UserDashboard);
